(function() {
  'use strict';

  var canvas = document.getElementById('canvas'),
    ctx = canvas.getContext('2d'),
  img = new Image(),
    currentFrame = 0,
    totalFrame = 20,
    offset = .01,
    width,
    height,
    imgData,
    data,
      
    pr = window.devicePixelRatio || 1,
    w = window.innerWidth,
    h = window.innerHeight,
      
    requestAnimationFrame = window.requestAnimationFrame || window.mozRequestAnimationFrame ||
    window.webkitRequestAnimationFrame || window.msRequestAnimationFrame;

  window.requestAnimationFrame = requestAnimationFrame;

  img.crossOrigin = "Anonmyous";
  img.src = 'data:image/png;base64,';


  img.onload = function() {
    init();
    glitchAnimation();
  };

  var init = function() {
    
    canvas.width = width = img.width;
    canvas.height = height = img.height;
    offset = width * offset;
  }.bind(this);

  var glitchAnimation = function() {

	setInterval(styleBase, 500 + randInt(0-4500));
	setInterval(styleOverlay, 5000);
	setInterval(styleInvert, 7000);

    if (!(currentFrame % totalFrame) || currentFrame > totalFrame) {

      clearCanvas();

      ctx.drawImage(img,
        0,
        0,
        img.width,
        img.height,
        offset,
        0,
        width - offset * 2,
        height);

      imgData = ctx.getImageData(0, 0, width, height);

      imgData = pixelProcessor(imgData, 4, pixelCooler);

      ctx.putImageData(imgData, 0, 0);

      currentFrame = 0;
    }

    if (currentFrame === randInt(0, totalFrame)) {

      imgData = pixelProcessor(imgData, 1, pixelFlick);

      ctx.putImageData(imgData, 0, 0);

      drawGlitch(width, height, randInt(3, 10), glitchBlock);

      drawGlitch(width, height, randInt(3, 30), glitchLine);
    }

    currentFrame++;
	
    window.requestAnimationFrame(glitchAnimation);
  };



  var styleBase = function() {
	ctx.filter = 'none';
	}; 
	
  var styleOverlay = function() {
	var x = randInt(25, 360);
		ctx.filter = 'hue-rotate(' + x + 'deg) saturate(2) contrast(110%) brightness(110%)';
	}; 
	
  var styleInvert = function() {
	 var x = randInt(25, 360);
	ctx.filter = 'invert(100%) blur(2px) brightness(75%) contrast(300%) hue-rotate(' + x + 'deg)';
	}; 
	
  var filterSharp = function() {
  Filters.tmpCanvas = document.createElement('canvas');
  Filters.tmpCtx = Filters.tmpCanvas.getContext('2d');

Filters.createImageData = function(w,h) {
  return this.tmpCtx.createImageData(w,h);
};

Filters.convolute = function(pixels, weights, opaque) {
  var side = Math.round(Math.sqrt(weights.length));
  var halfSide = Math.floor(side/2);
  var src = pixels.data;
  var sw = pixels.width;
  var sh = pixels.height;
  // pad output by the convolution matrix
  var w = sw;
  var h = sh;
  var output = Filters.createImageData(w, h);
  var dst = output.data;
  // go through the destination image pixels
  var alphaFac = opaque ? 1 : 0;
  for (var y=0; y<h; y++) {
    for (var x=0; x<w; x++) {
      var sy = y;
      var sx = x;
      var dstOff = (y*w+x)*4;
      // calculate the weighed sum of the source image pixels that
      // fall under the convolution matrix
      var r=0, g=0, b=0, a=0;
      for (var cy=0; cy<side; cy++) {
        for (var cx=0; cx<side; cx++) {
          var scy = sy + cy - halfSide;
          var scx = sx + cx - halfSide;
          if (scy >= 0 && scy < sh && scx >= 0 && scx < sw) {
            var srcOff = (scy*sw+scx)*4;
            var wt = weights[cy*side+cx];
            r += src[srcOff] * wt;
            g += src[srcOff+1] * wt;
            b += src[srcOff+2] * wt;
            a += src[srcOff+3] * wt;
          }
        }
      }
      dst[dstOff] = r;
      dst[dstOff+1] = g;
      dst[dstOff+2] = b;
      dst[dstOff+3] = a + alphaFac*(255-a);
    }
  }
  return output;
};
  }

  var pixelFlick = function(i, d) {
    d[i] = d[i + 16];
  };

  var pixelCooler = function(i, d) {
    d[i] = 60;
    d[i] += randInt(2, 15);
  };

  var glitchBlock = function(i, x, y) {
    if (i > 3) {
      var spliceHeight = 1 + randInt(0, 10);

      ctx.drawImage(canvas,
        x,
        y,
        x,
        spliceHeight,
        randInt(0, x),
        y,
        randInt(x, width),
        spliceHeight);
    }
  };

  var glitchLine = function(i, x, y) {
    var spliceHeight = 1 + randInt(1, 50);

    ctx.drawImage(canvas,
      offset,
      y,
      width - offset * 2,
      spliceHeight,
      1 + randInt(0, offset * 2), 
      y + randInt(0, 10),
      width - offset,
      spliceHeight);
  };

  var pixelProcessor = function(imageData, step, callback) {
    var data = imageData.data || [],
      step = step * 4 || 4;

    if (data.length) {
      var rgb = [];

      for (var i = 0; i < data.length; i += step) {
        callback && callback(i, data);
      }

      return imageData;
    } else {
      return imageData;
    }
  };

  var drawGlitch = function(width, height, amount, callback) {
    for (var i = 0; i < (amount || 10); i++) {
      var x = Math.random() * width + 1,
        y = Math.random() * height + 1;

      callback(i, x, y);
    }
  };

  var randInt = function(a, b) {
    return ~~(Math.random() * (b - a) + a);
  };

  var clearCanvas = function() {
    ctx.clearRect(0, 0, width, height);
  };
})();